import React, { Component } from 'react';

import './Navigation.css';

function Navigation() {
  return (
    <nav>
      <h2 className="logo" > { this.props } </h2>
      <ul>
        <li> <a href="#Home"> Home </a> </li>
        <li> <a href="#About"> About </a> </li>
        <li> <a href="#Contact"> Contact </a> </li>
      </ul>
    </nav>
  );
}

export default Navigation;
